import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the login form
    await page.waitForSelector('#email');
    await page.fill('#email', 'your_email@example.com'); // Using ID selector for email

    await page.waitForSelector('#password');
    await page.fill('#password', 'your_password'); // Using ID selector for password

    await page.waitForSelector('button.login-btn');
    await page.click('button.login-btn'); // Clicking the login button using class selector

    // Wait for navigation after login
    await page.waitForLoadState('networkidle');

    // Take a screenshot after login attempt
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_login_attempt.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_login_attempt.png'));

    // Extract some meaningful data to confirm login
    const loggedInUser = await page.evaluate(() => {
      return document.querySelector('.user-profile') ? document.querySelector('.user-profile').textContent : null;
    });

    return {
      success: true,
      action: "Logged in successfully and extracted user data",
      extractedData: { user: loggedInUser },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
